import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../App.css';

const Componente = () => {
    return (
        <div className='App-header'>
            <h1>No te pienso vender ni un chocolatín</h1>
        </div>
    )
}

export const NuestrosProductos = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
